function trim(stringToTrim,carac) {
  stringToTrim = stringToTrim + '';
  if (carac == undefined || carac.length == 0) {
    carac = '\\s';
  }
  else if (carac.length == 1 && (carac < '0' || carac > '9')) {
    carac = '\\' + carac;
  }
  return stringToTrim.replace(new RegExp('^' + carac + '+|' + carac + '+$', 'g'),'');
}
function ltrim(stringToTrim,carac) {
  stringToTrim = stringToTrim + '';
  if (carac == undefined || carac.length == 0) {
    carac = '\\s';
  }
  else if (carac.length == 1 && (carac < '0' || carac > '9')) {
    carac = '\\' + carac;
  }
  return stringToTrim.replace(new RegExp('^' + carac + '+'),'');
}
function rtrim(stringToTrim,carac) {
  stringToTrim = stringToTrim + '';
  if (carac == undefined || carac.length == 0) {
    carac = '\\s';
  }
  else if (carac.length == 1 && (carac < '0' || carac > '9')) {
    carac = '\\' + carac;
  }
  return stringToTrim.replace(new RegExp(carac + '+$'),'');
}


function chr(ascii) {  
  return String.fromCharCode(ascii);  
}  


//Armazena o menu da vez...
var mapMenu = {};

//Zera o menu
function zeraMenu(nomeMenu) {
  mapMenu.frases = '';
  mapMenu.mascara = 0;
  mapMenu.log = '';
  if (nomeMenu == undefined) {
    aplMenuAtual = '';
  }
  else {
    navegacaoIniciouMenu(nomeMenu);
  }
}

//Inclui uma opcao no menu (frase e número da opção)
function incluiOpcaoMenu(opcao, frase) {
  if (trim(frase) != '') {
    if (mapMenu.frases != '') {
      mapMenu.frases += ';';
    }
    mapMenu.frases += frase;
  }
  if (opcao >= 0) {
    mapMenu.mascara += (1 << opcao);
    mapMenu.log += opcao + ' ';
  }
}

//Retorna o tipo de discagem no menu
function tipoRetornoMenu(opcao) {
  if (opcao == '!') return 'MENU_TIMEOUT';
  if (mapMenu.mascara & (1 << opcao)) 
    return 'MENU_OPCAO_OK';
  else 
