//Retorna uma string de tamanho t inteiramente composta de caracteres c
function strChar(c, t) {
  var s = ''; var i;
  for (i=0;i<t;i++) s=s+c;
  return s;
}

//Coloca na 'cadeia' n 'caracter' à esquerda até atingir o tamanho total (tt).
//Retorna o resultado
function charEsq(cadeia, caracter, tt) {
  var o = cadeia + ''; var t = o.length;
  return strChar (caracter, tt-t) + o;
}
// O mesmo que charEsq, porém limita a saida em extamente tt caracteres, mesmo se o tamanho da cadeia for maior
function charEsqLimita(cadeia, caracter, tt) {
  var o = cadeia + ''; var t = o.length;
  if (t > tt) {
    return right(o, tt);
  }
  else if (t < tt) {
    return strChar (caracter, tt-t) + o;
  }
  else {
    return o;
  }
}
//Coloca na 'cadeia' n 'caracter' à direita até atingir o tamanho total (tt).
//Retorna o resultado
function charDir(cadeia, caracter, tt) {
  var o = cadeia + ''; var t = o.length;
  return o + strChar (caracter, tt-t);
}
// O mesmo que charDir, porém limita a saida em extamente tt caracteres, mesmo se o tamanho da cadeia for maior
function charDirLimita(cadeia, caracter, tt) {
  var o = cadeia + ''; var t = o.length;
  if (t > tt) {
    return o.substr(0, tt);
  }
  else if (t < tt) {
    return o + strChar (caracter, tt-t);
  }
  else {
    return o;
  }
}

//Valor monetário to fala
//valor = valor numérico com no máximo duas casas decimais
//retorna => string no esquema para falar o valor (monetário).
//ex: valor = .1 ; retorna '010'
//ex: valor = 2 ; retorna '200'
//ex: valor = 2.53 ; retorna '253'
//Sivelli- Alterado para aceitar valores com mais de 2 casas decimais. Nesse caso, trunca para 2 casas
//Sivelli- Alterado para aceitar qual o caracter da virgula. se ausente, assume .
//Sivelli- Alterado para indicar o numero de casas decimais da saida (default 2)
function valMonetToFala(valor,cVirg,casasDecimais) {

  try {
    if (typeof(valor) == 'number' || typeof(cVirg) != 'string') {
      cVirg = '.';
    }
    if (typeof(casasDecimais) != 'number') {
      casasDecimais = 2;
    }
    var v = valor + '';
    var s = v.split(cVirg);
    if (s[0] == '') {
      s[0] = '0';
    }
    if (casasDecimais > 0) {
      if (typeof(s[1]) != 'undefined') {
        if (s[1].length < casasDecimais) {
          s[1] += strChar('0', casasDecimais - s[1].length);
        }
        else if (s[1].length > casasDecimais) {
          s[1] = s[1].substr(0,casasDecimais);
        }
      } else {
        s[1] = strChar('0', casasDecimais);
      }
      return s[0] + s[1];
    }
    else {
      return s[0];
    }
  } catch (e) {
    logger.info('valMonetToFala - Erro na conversão do valor ' + valor);
    return '000';
  }
}

function valMonetToFalaLista(valor,lstCarac,casasDecimais) {
  var v = valor + '';
  var l = lstCarac + '';
  var i;

  for (i=0; i < l.length; i++) {
    if (v.indexOf(l.substr(i,1)) >= 0) {
      return valMonetToFala(v, l.substr(i,1), casasDecimais);
    }
  }
  return valMonetToFala(v, null, casasDecimais);
}

//Retorna a string formada só pelos dígitos do parâmetro
function soDigitos(entrada) {
  var e = trim(entrada + '');
  var s = '';
  var i;
  for (i=0;i<e.length;i++) {
    if (DNKBiblioteca.stringNumerica(e.charAt(i))) {
      s+=e.charAt(i);
    }
  }
  return s;
}
// Formata uma sequencia de digitos, colocando . no como separador das casas decimais
// se casasDecimaisEntrada indica quantas casas decimais tem o numero. Se ausente, ou 0, assume que depende da posição da virgula (ou ponto)
// casasDecimaisSaida controla quantas casas decimais serão incluidas na saida, se ausente assume o valor passado em casasDecimaisEntrada ou 2, se não foi passado nenhum valor
function formataNumero(numero,casasDecimaisEntrada,casasDecimaisSaida)
{
  var casasSaidaDef = 2;
  numero += '';
  if (typeof(casasDecimaisEntrada) == 'number') {
    casasSaidaDef = casasDecimaisEntrada;
    if (casasDecimaisEntrada > 0) {
      if (numero.length <= casasDecimaisEntrada) {
        numero = '0.' + strChar('0', casasDecimaisEntrada - numero.length) + numero;
      }
      else {
        numero = numero.substr(0, numero.length - casasDecimaisEntrada) + '.' + numero.substr(numero.length - casasDecimaisEntrada, casasDecimaisEntrada);
      }
    }
  }
  if (typeof(casasDecimaisSaida) != 'number') {
    casasDecimaisSaida = 2;
  }
  if (casasDecimaisSaida > 0) {
    var saida = ltrim(DNKBiblioteca.formataStringDtoE(valMonetToFalaLista(numero, '.,',casasDecimaisSaida), numero.length + '.' + casasDecimaisSaida), '0');
    if (saida.substr(0,1) == '.') {
      return '0' + saida;
    }
    else {
      return saida;
    }
  }
  else {
    return valMonetToFalaLista(numero, '.,', 0);
  }
}

function navegacaoInicio() {
  aplMenuAtual = '';
  aplNavegacao = '';
}

function navegacaoIniciouMenu(nomeMenu) {
  if (aplMenuAtual != nomeMenu) {
    aplMenuAtual = nomeMenu;
    // Seta horário de inicio??
    // Coloca menu na lista de navegacao
    if (aplNavegacao == '') {
      aplNavegacao = aplMenuAtual;
    }
    else {
      aplNavegacao += '|' + aplMenuAtual;
    }
  }
}

function navegacaoSaiuMenu(opcao, limpa) {
  if (aplMenuAtual != '') {
    if (opcao != undefined) {
      aplNavegacao += '[' + opcao + ']';
    }
    if (limpa != undefined && limpa) {
      aplMenuAtual = '';
    }
  }  
}

