//Coloca a máscara no cartão para poder logar.
//De '1234567890123456' para '123456XXXXXX3456'
//De '1234.5678.9012.3456' para '1234.56XX.XXXX.3456'
function mascaraCartaoLog(cartao) {
  var kt = trim(cartao);

  if (kt.length < 16) {
    kt = kt + 'XXXXXXXXXXXXXXXX';
  }

  if (kt.length == 16) {
    kt = kt.substr(0, 6) + 'XXXXXX' + kt.substr(12, 4);
  } else {
    //Assume que está formatado com '.' de 4 em 4
    kt = kt.substr(0, 7) + 'XX.XXXX.' + kt.substr(15, 4);
  }
  return kt;
}

function isEmptyObj(obj) {
  return Object.keys(obj).length === 0;
}

function leArqConfigGrava() {
  //Grava a ligação?
  aplGravaLigacao = DNKBiblioteca.propLe('D:/DNK/URA/Gravacao.config', 'GravaLigacao');
  if (aplGravaLigacao == null) {
    aplGravaLigacao = GRAVA_LIGACAO_NENHUMA; //Não existe nada configurando  - assume que não deve gravar a ligação
  } else {
    if (aplGravaLigacao != GRAVA_LIGACAO_NENHUMA &&
        aplGravaLigacao != GRAVA_LIGACAO_TX &&
        aplGravaLigacao != GRAVA_LIGACAO_RX &&
        aplGravaLigacao != GRAVA_LIGACAO_TXRX) {
          aplGravaLigacao = GRAVA_LIGACAO_NENHUMA; //Configuração inválida - assume que não deve gravar a ligação
        }
  }
  logger.info('aplGravaLigacao=' + aplGravaLigacao);
}

function retornaIpAspect(){
  if(TRANSFIP9.indexOf(';' + aplGrupoDerivacao + ';' >= 0)) return '10.20.131.9';

  else if(TRANSFIP10.indexOf(';' + aplGrupoDerivacao + ';' >= 0))return '10.20.131.10';

  else return IP_TRANSFERENCIA; 

}

function formataValor(stringToFormat) {
//formata a entrada para que tenha dois digitos para centavos e sem virgula.
  //OBS: caso o formato de entrada seja diferente de 'N,NN', esta funcao trata:
// * o ponto no lugar da virgula,
// * nao vir ponto ou virgula indicando os centavos,
// * ter a virgula (ou ponto) mas apenas um dígitou ou nenhum após a virgula (ou ponto).

    var i;
    var newValor = String(stringToFormat);


    //procura ponto para trocar por virgula
    i = newValor.indexOf(".");
    //se tiver .(ponto), troca .(ponto) por ,(virgula)
    if (i>=0) {
        newValor = newValor.substr(0,i) + ',' + newValor.substr(i+1);
    }     

    //procura virgula
    i = newValor.indexOf(",");
    if (i>=0) {
        //achou virgula, so pode ter dois digitos apos a virgula
        if ((i+2) >= newValor.length) {
            //newValor = (N. ou NNN.N), acrescenta dois zeros para ter certeza de que haverá pelo menos dois digitos apos virgula
            newValor += '00';
        }
        //pega apenas os dois últimos
        newValor = newValor.substr(0,i) + newValor.substr(i+1,2);
    }
    else {  //nao achou a virgula, precisa colocar dois zeros finais
        newValor += '00';
    }
  logger.info('formataValor: original=' + stringToFormat + ' formatado=' + newValor);
    return newValor;
}

function GetCallIDFromUUI(){
    //...
    var ascII = hex_to_ascii(sipUserToUser.substr(4));

    logger.info('UUI em ASCII: ' + ascII.toString());  
    //...
    var dadosUUI = ascII.split("|");

    logger.info('NumA = ' + dadosUUI[1] + 
                ', CPF = ' + dadosUUI[2] + 
                ', Cartao = ' + dadosUUI[4] + 
                ', Nome Cliente = ' + dadosUUI[3] + 
                ', Identificado = ' + dadosUUI[5] + 
                ', CallID = ' + dadosUUI[0]+ 
                ', VDN = ' + dadosUUI[9]+ 
                ', LOGIN PA = ' + dadosUUI[10]);

    return dadosUUI[0];
}

