function dentroHorario() {
  var hoje = DNKBiblioteca.dthrPega('E', aplLocaleEUA);
  var agora = DNKBiblioteca.dthrPega('HHmm', aplLocaleEUA);
  var agora2 = parseInt(agora,10);
  //Horário aos domingos => das 8 às 20hs
  //Outros dias => das 8 às 22hs
  logger.info('Hora atual: ' + agora2);
  logger.info('Hora inicial: ' + PARAMETRO_HORA_INI);
  logger.info('Hora Fim: ' + PARAMETRO_HORA_FIM);

  if ((hoje != 'Sun' && hoje != 'Sat') && (parseInt(agora2,10) >= parseInt(PARAMETRO_HORA_INI,10) && parseInt(agora2,10) < parseInt(PARAMETRO_HORA_FIM,10))) {
    logger.info('Dentro do horario de atendimento');
    return true;
  }
else if((hoje == 'Sat') && (parseInt(agora2,10) >= parseInt(PARAMETRO_HORA_INI_SABADO,10) && parseInt(agora2,10) < parseInt(PARAMETRO_HORA_FIM_SABADO,10))) {
    logger.info('Dentro do horario de atendimento');
    return true;
  }  
  else {
    logger.info('Fora do horario de atendimento');
    return false;
  }
}



function feriado() {

  dataCorrente = DNKBiblioteca.dthrPega('dd/MM');
  dataFeriado = PARAMETRO_DATA_FERIADO;

  var agora = DNKBiblioteca.dthrPega('HHmm', aplLocaleEUA);
  var agora2 = parseInt(agora,10);

  if(dataFeriado.indexOf(dataCorrente) != -1)
  {
    if(PARAMETRO_HORA_INI_FERIADO == 'FECHAR')
    {
      logger.info('Feriado programado, sem atendimento');
      return true;
    }
    else if (parseInt(agora2,10) >= parseInt(PARAMETRO_HORA_INI_FERIADO,10) && parseInt(agora2,10) < parseInt(PARAMETRO_HORA_FIM_FERIADO,10)) 
    {
      logger.info('Feriado programado, atendimento parcial');
      return false;
    } 
    else 
    {
      logger.info('Feriado programado, Fora do horario');
      return true;
    }
  }
  else
  {
    logger.info('Sem feriado programado');
    return false;
  }  
}

